import React from "react";

const Gallery = () => {
  return (
    <>
      <Flex paddingY={2}>
        <SortSelector
          sortOrder={gameQuery.sortOrder}
          onSelectSortOrder={(sortOrder) =>
            setGameQuery({ ...gameQuery, sortOrder })
          }
        />
      </Flex>
    </>
  );
};

export default Gallery;
